import axios from 'axios';
import React from 'react';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      listData: [],
    };
  }

  //
  async componentDidMount() {
    this.loadData();
    const token = localStorage.getItem('token') || '';
    console.log('check', token);
    if (!token) {
      this.props.history.push('/login');
    }
  }

  render() {
    return <div></div>;
  }
}

export default Home;
